//   }
// ];

const rental = [
  {
    id: 1,
    title: "testing"
  },
  {
    id: 2,
    title: "oto"
  }
];

export const fetchRentals = () => dispatch => {
  //   return {
  //     type: FETCH_RENTALS,
  //     rentals
  //   };
  dispatch({ type: FETCH_RENTALS, rentals });
};

export const fetchRentalsById = rentalId => dispatch => {
  const rental = rentals.find(rental => rental.id === rentalId);
  dispatch({ type: FETCH_RENTALS_BY_ID, rental });
};
